import React, { Component } from "react";

const styles = {
  textAlign: "center"
}

class InfoText extends Component {
  render() {
      return (
        <h2 style={styles}>Economize mais com os Planos FaleMais da Telzir, compare!</h2>
    );
  }
}

export default InfoText;
